// AccessKey.js
import React, { Component, Img } from 'react';
import App from '../App'
import { Menu, Icon, Layout, Breadcrumb } from 'antd';

class AccessKey extends Component {
  constructor (props) {
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this);
    this.input = props.input;
  }
  state = {
    show: true
  }
  handleSubmit (e) {
    if (this.input.value === "0" && this.state.show === true) {
      alert("VALUE:" + this.input.value);
      e.preventDefault();
    }
  }
  render () {
    return (
      <form onSubmit={this.handleSubmit}>
        <label> Enter Access Key
          <input type="text" ref={(input) => this.input = input}/>
        </label>
        <input type="submit" value="Submit"/>
      </form>
    )
  }
}

export default AccessKey;
